        $.ajax({
            type : "GET",
            url:"https://api.covid19api.com/summary",
            dataType: 'json',
            error: function (err) { 
                console.error(err);
            },
            success:function (res) {
                console.log(res);
            },
        })

    }

    WorldDate();


    return <div className="World_wrap">
        <input type="radio" className="input" name="rotate" id="btn1" />
        <input type="radio" className="input" name="rotate" id="btn2" />
